<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" lang xml:lang>
  <head>
    <title>Introduction to R Markdown - Workshop</title>
    <meta charset="utf-8" />
    <meta name="author" content="Saghir Bashir" />
    <style type="text/css">a, a > code {
color: rgb(249, 38, 114);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 3em;
padding-right: 4em;
font-size: 90%;
}
.remark-code-line-highlighted { background-color: #ffff88; }
.inverse {
background-color: #272822;
color: #d6d6d6;
text-shadow: 0 0 20px #333;
}
.inverse h1, .inverse h2, .inverse h3 {
color: #f3f3f3;
}

.left-column {
color: #777;
width: 20%;
height: 92%;
float: left;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #000;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right ~ * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px lightgray;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th { border-bottom: 1px solid #ddd; }
th, td { padding: 5px; }
.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) { background: #eee }
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
</style>

.center[# What is Markdown?]

## Special computer language (&quot;Markup&quot;)

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Plain text file with special syntax.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Human readable.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - &quot;Tags&quot; define Structure &amp; elements.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Converts to HTML, PDF, ...

---
&lt;div class=&quot;Rmarkdown-hex-right-top&quot;&gt;&lt;/div&gt; 

.center[# Markdown Example]

.pull-left[
```
# Markdown Example

Paragraphs are separated by a blank line.

## Format text

Some _italic_, **bold** and `monospace` text.

Bullet list
+ Apples.
+ Oranges.
+ Pears

An [example link](https://github.com/saghirb)..
```
]

## A mix of R and markdown

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - R code and documentation in one place.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Great for doing reproducible research.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Great for collaborating and sharing.

### &amp;nbsp;&amp;nbsp;&amp;nbsp; - Converts to HTML, PDF, websites, article, books, ...

Some _summary statistics_ for the **R** `ChickWeight` data.


```r
library(data.table)
cw &lt;- as.data.table(ChickWeight)
cw[Time %in% c(0, 21)][ 
  , .(N = .N, Mean = mean(weight), 
      SD = sd(weight)), by = .(Diet, Time)][ 
    order(Diet, Time)] 
```
